import React, { Component} from "react";
import data from "./data";


class TeamTwo extends Component {
    constructor(props) {
        super(props)
        this.state = {
           
            teams: [],
            

        
        };
        
    }
   
    componentDidMount() {
       
        this.TeamsList()
       
      }
      TeamareasList(){
        axios.get('http://localhost:8000/api/teams/').then(res => res.data)
        .then(res => {
            this.setState({
                teams: res.data
            });
            
          })
          .catch((error) => {
            console.log(error);
          })
    }
    render() {
    return (
        <div className="row">
            {itemSlice.map((value , i ) => (
                <div className={`${props.column}`} key={i}>
                    <div className={`team-static ${props.teamStyle}`}>
                        <div className="thumbnail">
                            <img src={`/assets/images/team/team-${value.images}.jpg`} alt="Blog Images"/>
                        </div>
                        <div className="inner">
                            <div className="content">
                                <h4 className="title">{value.title}</h4>
                                <p className="designation">{value.designation}</p>
                            </div>
                            <ul className="social-transparent liststyle d-flex" >
                                {value.socialNetwork.map((social, index) =>
                                    <li key={index}><a href={`${social.url}`}>{social.icon}</a></li>
                                )}
                            </ul>
                        </div>
                    </div>
                </div>
            ))}
        </div>
    )
}
}

export default TeamTwo
